void InitialiseGlyph(){

    int i;
    int j;

    /* This image struct represents the above data as an object. */
    const Image ASCII_IMAGE = {128, 128, (PixelRGBA*)&ASCII_DATA};

    /* Generate all 256 image handles. */
    glGenTextures(256, glyph);

    /* Upload each seperate glyph to the graphics card. */
    for(j = 0; j < 16; j++){
        for(i = 0; i < 16; i++){

            /* Derive the location of the glyph from the ASCII_IMAGE. */
            Image *c = cropImage(&ASCII_IMAGE, i*GLYPH_WIDTH, j*GLYPH_HEIGHT, GLYPH_WIDTH, GLYPH_HEIGHT);

            /* Upload the glyph data. */
            glBindTexture   (GL_TEXTURE_2D, glyph[i + j * 16]);
            glTexImage2D    (GL_TEXTURE_2D, 0, GL_RGBA, c->width, c->height, 0, GL_RGBA, GL_UNSIGNED_BYTE, c->data);
            glTexParameteri (GL_TEXTURE_2D, GL_TEXTURE_MAG_FILTER, GL_NEAREST);
            glTexParameteri (GL_TEXTURE_2D, GL_TEXTURE_MIN_FILTER, GL_NEAREST);

            /* Free allocated memory. */
            destroyImage(c);
        }
    }
}

void CleanupGlyph(){
    glDeleteTextures(256, glyph);
}

void RenderGlyph(const char g, float x, float y, float w, float h){

    glBindTexture(GL_TEXTURE_2D, glyph[g]);

    glBegin(GL_TRIANGLE_STRIP);
        glTexCoord2f(0.0f, 0.0f); glVertex2f ( x + 0.0f, y + 0.0f );
        glTexCoord2f(0.0f, 1.0f); glVertex2f ( x + 0.0f, y + h    );
        glTexCoord2f(1.0f, 0.0f); glVertex2f ( x + w,    y + 0.0f );
        glTexCoord2f(1.0f, 1.0f); glVertex2f ( x + w,    y + h    );
    glEnd();
}

void RenderString(const char *string, float x, float y, float w, float h){

    const char *current_char = string;

    while(*current_char != '\0'){
        RenderGlyph(*(current_char++), x, y, w, h);
        x += w;
    }
}